import React,{Component} from 'react';
import 'tachyons';
import './Nav.css';
import ScriptTag from 'react-script-tag';

const Nav =({onRouteChange,route})=>
{
    return (
      <div>
      <div className="Home" style={{backgroundcolor:'black'}}>
      <div className="topnav">
       <h5 className="head mt-3">  Debugged.exe </h5>
       &nbsp;
       <ol className="navhead">
        <li className={`nav f4 left ul ${route==='home'? 'active':null}`} onClick={()=>onRouteChange('home')}>About us</li>
        <li  className= {`nav f4 left ul ${route==='work'? 'active':null}`} onClick={()=>onRouteChange('work')}>Our work</li>
        <li  className={ `nav f4 left ul ${route==='contact'? 'active':null}`} onClick={()=>onRouteChange('contact')}>Contact us</li>
       </ol>
       </div>
     </div>
     </div>

    );
  }

export default Nav;
